import React from 'react';

function CarItem({ car }) {
    return (
        <div className="car-item">
            <h3>ID: {car.idCar || "N/A"}</h3>
            <p>Kilometri: {car.kilometers}</p>
            <p>An fabricație: {car.releaseDate}</p>
            <p>Model: {car.model}</p>
            <p>: {car.vehicleType}</p>
            <p>Price: {car.price} €</p>
            <p>Color: {car.color}</p>
        </div>
    );
}

export default CarItem;
